import React from "react";

const Cards = (props) => {
  const { id, name, email } = props;
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow shadow-5 bw2 tc">
      <img src={`https://robohash.org/${props.id}200x200`} alt="robots" />
      <div>
        <h2>{props.name}</h2>
        <p>{props.email}</p>
      </div>
    </div>
  );
};

export default Cards;
